import React from 'react';
import Title from '../../components/Title/Title';
import 'TiposEventos'

const TipoEventos = () => {
    return (
        <div>
            <Title
                titleText={"Página Tipo Eventos"}
                additionalClass={'margem-acima'}
            />
        </div>
    );
};  

export default TipoEventos;
